/** Immediately switch to a different input stream.
 * @param input_file A readable stream.
 * 
 * @note This function does not reset the start condition to @c INITIAL .
 */
    void jjrestart  (FILE * input_file )
{
    
	if ( ! YY_CURRENT_BUFFER ){
        jjensure_buffer_stack ();
		YY_CURRENT_BUFFER_LVALUE =
            jj_create_buffer(jjin,YY_BUF_SIZE );
	}

	jj_init_buffer(YY_CURRENT_BUFFER,input_file );
	jj_load_buffer_state( );
}

/** Switch to a different input buffer.
 * @param new_buffer The new input buffer.
 * 
 */
    void jj_switch_to_buffer  (YY_BUFFER_STATE  new_buffer )
{
    
	/* TODO. We should be able to replace this entire function body
	 * with
	 *		jjpop_buffer_state();
	 *		jjpush_buffer_state(new_buffer);
     */
	jjensure_buffer_stack ();
	if ( YY_CURRENT_BUFFER == new_buffer )
		return;

	if ( YY_CURRENT_BUFFER )
		{
		/* Flush out information for old buffer. */
		*(jj_c_buf_p) = (jj_hold_char);
		YY_CURRENT_BUFFER_LVALUE->jj_buf_pos = (jj_c_buf_p);
		YY_CURRENT_BUFFER_LVALUE->jj_n_chars = (jj_n_chars);
		}

	YY_CURRENT_BUFFER_LVALUE = new_buffer;
	jj_load_buffer_state( );

	/* We don't actually know whether we did this switch during
	 * EOF (yywrap()) processing, but the only time this flag
	 * is looked at is after yywrap() is called, so it's safe
	 * to go ahead and always set it.
	 */
	(jj_did_buffer_switch_on_eof) = 1;
}

static void jj_load_buffer_state  (void)
{
    	(jj_n_chars) = YY_CURRENT_BUFFER_LVALUE->jj_n_chars;
	(jjtext_ptr) = (jj_c_buf_p) = YY_CURRENT_BUFFER_LVALUE->jj_buf_pos;
	jjin = YY_CURRENT_BUFFER_LVALUE->jj_input_file;
	(jj_hold_char) = *(jj_c_buf_p);
}

/** Allocate and initialize an input buffer state.
 * @param file A readable stream.
 * @param size The character buffer size in bytes. When in doubt, use @c YY_BUF_SIZE.
 * 
 * @return the allocated buffer state.
 */
    YY_BUFFER_STATE jj_create_buffer  (FILE * file, int  size )
{
	YY_BUFFER_STATE b;
    
	b = (YY_BUFFER_STATE) jjalloc(sizeof( struct jj_buffer_state )  );
	if ( ! b )
		YY_FATAL_ERROR( "out of dynamic memory in jj_create_buffer()" );

	b->jj_buf_size = size;

	/* jj_ch_buf has to be 2 characters longer than the size given because
	 * we need to put in 2 end-of-buffer characters.
	 */
	b->jj_ch_buf = (char *) jjalloc(b->jj_buf_size + 2  );
	if ( ! b->jj_ch_buf )
		YY_FATAL_ERROR( "out of dynamic memory in jj_create_buffer()" );

	b->jj_is_our_buffer = 1;

	jj_init_buffer(b,file );

	return b;
}

/** Destroy the buffer.
 * @param b a buffer created with jj_create_buffer()
 * 
 */
    void jj_delete_buffer (YY_BUFFER_STATE  b )
{
    
	if ( ! b )
		return;

	if ( b == YY_CURRENT_BUFFER ) /* Not sure if we should pop here. */
		YY_CURRENT_BUFFER_LVALUE = (YY_BUFFER_STATE) 0;

	if ( b->jj_is_our_buffer )
		jjfree((void *) b->jj_ch_buf  );

	jjfree((void *) b  );
}

/* Initializes or reinitializes a buffer.
 * This function is sometimes called more than once on the same buffer,
 * such as during a jjrestart() or at EOF.
 */
    static void jj_init_buffer  (YY_BUFFER_STATE  b, FILE * file )

{
	int oerrno = errno;
    
	jj_flush_buffer(b );

	b->jj_input_file = file;
	b->jj_fill_buffer = 1;

    /* If b is the current buffer, then jj_init_buffer was _probably_
     * called from jjrestart() or through jj_get_next_buffer.
     * In that case, we don't want to reset the lineno or column.
     */
    if (b != YY_CURRENT_BUFFER){
        b->jj_bs_lineno = 1;
        b->jj_bs_column = 0;
    }

        b->jj_is_interactive = file ? (isatty( fileno(file) ) > 0) : 0;
    
	errno = oerrno;
}

/** Discard all buffered characters. On the next scan, YY_INPUT will be called.
 * @param b the buffer state to be flushed, usually @c YY_CURRENT_BUFFER.
 * 
 */
    void jj_flush_buffer (YY_BUFFER_STATE  b )
{
    	if ( ! b )
		return;

	b->jj_n_chars = 0;

	/* We always need two end-of-buffer characters.  The first causes
	 * a transition to the end-of-buffer state.  The second causes
	 * a jam in that state.
	 */
	b->jj_ch_buf[0] = YY_END_OF_BUFFER_CHAR;
	b->jj_ch_buf[1] = YY_END_OF_BUFFER_CHAR;

	b->jj_buf_pos = &b->jj_ch_buf[0];

	b->jj_at_bol = 1;
	b->jj_buffer_status = YY_BUFFER_NEW;

	if ( b == YY_CURRENT_BUFFER )
		jj_load_buffer_state( );
}

/** Pushes the new state onto the stack. The new state becomes
 *  the current state. This function will allocate the stack
 *  if necessary.
 *  @param new_buffer The new state.
 *  
 */
void jjpush_buffer_state (YY_BUFFER_STATE new_buffer )
{
    	if (new_buffer == NULL)
		return;

	jjensure_buffer_stack();

	/* This block is copied from jj_switch_to_buffer. */
	if ( YY_CURRENT_BUFFER )
		{
		/* Flush out information for old buffer. */
		*(jj_c_buf_p) = (jj_hold_char);
		YY_CURRENT_BUFFER_LVALUE->jj_buf_pos = (jj_c_buf_p);
		YY_CURRENT_BUFFER_LVALUE->jj_n_chars = (jj_n_chars);
		}

	/* Only push if top exists. Otherwise, replace top. */
	if (YY_CURRENT_BUFFER)
		(jj_buffer_stack_top)++;
	YY_CURRENT_BUFFER_LVALUE = new_buffer;

	/* copied from jj_switch_to_buffer. */
	jj_load_buffer_state( );
	(jj_did_buffer_switch_on_eof) = 1;
}

/** Removes and deletes the top of the stack, if present.
 *  The next element becomes the new top.
 *  
 */
void jjpop_buffer_state (void)
{
    	if (!YY_CURRENT_BUFFER)
		return;

	jj_delete_buffer(YY_CURRENT_BUFFER );
	YY_CURRENT_BUFFER_LVALUE = NULL;
	if ((jj_buffer_stack_top) > 0)
		--(jj_buffer_stack_top);

	if (YY_CURRENT_BUFFER) {
		jj_load_buffer_state( );
		(jj_did_buffer_switch_on_eof) = 1;
	}
}

/* Allocates the stack if it does not exist.
 *  Guarantees space for at least one push.
 */
static void jjensure_buffer_stack (void)
{
	jj_size_t num_to_alloc;
    
	if (!(jj_buffer_stack)) {

		/* First allocation is just for 2 elements, since we don't know if this
		 * scanner will even need a stack. We use 2 instead of 1 to avoid an
		 * immediate realloc on the next call.
         */
		num_to_alloc = 1;
		(jj_buffer_stack) = (struct jj_buffer_state**)jjalloc
								(num_to_alloc * sizeof(struct jj_buffer_state*)
								);
		if ( ! (jj_buffer_stack) )
			YY_FATAL_ERROR( "out of dynamic memory in jjensure_buffer_stack()" );
								  
		memset((jj_buffer_stack), 0, num_to_alloc * sizeof(struct jj_buffer_state*));
				
		(jj_buffer_stack_max) = num_to_alloc;
		(jj_buffer_stack_top) = 0;
		return;
	}

	if ((jj_buffer_stack_top) >= ((jj_buffer_stack_max)) - 1){

		/* Increase the buffer to prepare for a possible push. */
		int grow_size = 8 /* arbitrary grow size */;

		num_to_alloc = (jj_buffer_stack_max) + grow_size;
		(jj_buffer_stack) = (struct jj_buffer_state**)jjrealloc
								((jj_buffer_stack),
								num_to_alloc * sizeof(struct jj_buffer_state*)
								);
		if ( ! (jj_buffer_stack) )
			YY_FATAL_ERROR( "out of dynamic memory in jjensure_buffer_stack()" );

		/* zero only the new slots.*/
		memset((jj_buffer_stack) + (jj_buffer_stack_max), 0, grow_size * sizeof(struct jj_buffer_state*));
		(jj_buffer_stack_max) = num_to_alloc;
	}
}

/** Setup the input buffer state to scan directly from a user-specified character buffer.
 * @param base the character buffer
 * @param size the size in bytes of the character buffer
 * 
 * @return the newly allocated buffer state object. 
 */
YY_BUFFER_STATE jj_scan_buffer  (char * base, jj_size_t  size )
{
	YY_BUFFER_STATE b;
    
	if ( size < 2 ||
	     base[size-2] != YY_END_OF_BUFFER_CHAR ||
	     base[size-1] != YY_END_OF_BUFFER_CHAR )
		/* They forgot to leave room for the EOB's. */
		return 0;

	b = (YY_BUFFER_STATE) jjalloc(sizeof( struct jj_buffer_state )  );
	if ( ! b )
		YY_FATAL_ERROR( "out of dynamic memory in jj_scan_buffer()" );

	b->jj_buf_size = size - 2;	/* "- 2" to take care of EOB's */
	b->jj_buf_pos = b->jj_ch_buf = base;
	b->jj_is_our_buffer = 0;
	b->jj_input_file = 0;
	b->jj_n_chars = b->jj_buf_size;
	b->jj_is_interactive = 0;
	b->jj_at_bol = 1;
	b->jj_fill_buffer = 0;
	b->jj_buffer_status = YY_BUFFER_NEW;

	jj_switch_to_buffer(b  );

	return b;
}

