/* jjlex_destroy is for both reentrant and non-reentrant scanners. */
int jjlex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		jj_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		jjpop_buffer_state();
	}

	/* Destroy the stack itself. */
	jjfree((jj_buffer_stack) );
	(jj_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * jjlex() is called, initialization will occur. */
    jj_init_globals( );

    return 0;
}

